import "./Courses.css";

export default function AllCourses() {
  const courses = [
    { title: "Full Stack Development", color: "#ff6b6b" },
    { title: "Data Science", color: "#4dabf7" },
    { title: "Cyber Security", color: "#51cf66" },
    { title: "Career Guidance", color: "#f59f00" },
  ];

  return (
    <div className="course-container">
      {courses.map((course, i) => (
        <div key={i} className="course-card" style={{ background: course.color }}>
          <h3>{course.title}</h3>
          <p>Explore in-depth tutorials, projects, and career paths.</p>
        </div>
      ))}
    </div>
  );
}
